import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { EditHardcopySeComponent } from '../edit-hardcopy-se/edit-hardcopy-se.component';
import { SeClaimVerificationComponent } from '../se-claim-verification/se-claim-verification.component';
import {
  OthersSerbTableComponent
} from "app/claim/se-claim/se-claim-verification/working-data-section/others/others-serb-table/others-serb-table.component";
import {ViewLatestOwnerSeComponent} from "app/claim/se-claim/pop-up/view-latest-owner-se/view-latest-owner-se.component";
import {ViewPastClaimComponent} from "app/claim/pop-up/view-past-claim/view-past-claim.component";
import {ViewEclaimComponent} from "app/claim/se-claim/pop-up/view-eclaim/view-eclaim.component";
import { ViewRemarksComponent } from 'app/claim/pop-up/view-remarks/view-remarks.component';
import { ViewIrasComponent } from '../pop-up/view-iras/view-iras.component';
import { ViewSerbReportComponent } from '../pop-up/view-serb-report/view-serb-report.component';
import { ViewSupportingDocComponent } from 'app/claim/pop-up/view-supporting-doc/view-supporting-doc.component';
import { NewSeComponent } from 'app/workload/payroll-verifier/new-se/new-se.component';
import { NewEcComponent } from 'app/workload/payroll-verifier/new-ec/new-ec.component';
import { DataEntryComponent } from 'app/workload/payroll-verifier/data-entry/data-entry.component';
import { WorkloadInboxComponent } from 'app/workload/workload-inbox.component';
import { SeClaimCertificationComponent } from '../se-claim-certification/se-claim-certification.component';


const deductionRoutes: Routes = [
  {
    path: 'edit-hardcopy-se/:claimId',
    component: EditHardcopySeComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.edit-hardcopy-se.home.title',
      defaultSort: 'claimId,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'edit-hardcopy-se',
    component: EditHardcopySeComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.edit-hardcopy-se.home.title',
      defaultSort: 'nric,asc'
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'claim-verification-se',
    component: SeClaimVerificationComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.claim-verification-se.home.title',
      defaultSort: 'caseId,asc'
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'claim-certification-se',
    component: SeClaimCertificationComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.claim-certification-se.home.title',
      defaultSort: 'caseId,asc'
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'serb-table',
    component: OthersSerbTableComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.edit-hardcopy-se.home.title'
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'view-latest-owner',
    component: ViewLatestOwnerSeComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.view-latest-owner.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-past-claim',
    component: ViewPastClaimComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-past-claim.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-eclaim',
    component: ViewEclaimComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.view-eclaim.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-remarks',
    component: ViewRemarksComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-remarks.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-iras',
    component: ViewIrasComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.view-iras.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-serb-report',
    component: ViewSerbReportComponent,
    data: {
      pageTitle: 'nspay2App.claim.self-employed-claim.view-serb-report.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-supporting-doc',
    component: ViewSupportingDocComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-supporting-doc.home.title'
    },
    canActivate: [UserRouteAccessService]
  }
];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule]
})

export class SEClaimRoutingModule { }
